export const Icon: (props: {
    name: IconName;
    color?: string;
    size?: number;
    large?: boolean;
    "large-x"?: boolean;
    "large-xx"?: boolean;
    "large-3x"?: boolean;
    "large-4x"?: boolean;
    "large-5x"?: boolean;
    "large-6x"?: boolean;
    small?: boolean;
    "small-x"?: boolean;
    "small-xx"?: boolean;
    primary?: boolean;
    secondary?: boolean;
    grey?: boolean;
    white?: boolean;

}) => JSX.Element = styled(Ionicons).attrs(props => {
    let size = props.size || 26;
    if (props.large) {
        size = 30;
    } else if (props["large-x"]) {
        size = 34;
    } else if (props["large-xx"]) {
        size = 38;
    } else if (props["large-3x"]) {
        size = 42;
    } else if (props["large-4x"]) {
        size = 46;
    } else if (props["large-5x"]) {
        size = 50;
    } else if (props["large-6x"]) {
        size = 60;
    } else if (props["large-7x"]) {
        size = 70;
    } else if (props["large-8x"]) {
        size = 80;
    } else if (props["large-9x"]) {
        size = 90;
    } else if (props["large-10x"]) {
        size = 100;
    } else if (props.small) {
        size = 24;
    } else if (props["small-x"]) {
        size = 20;
    } else if (props["small-x"]) {
        size = 16;
    } else if (props["small-xx"]) {
        size = 12;
    } else if (props["small-3x"]) {
        size = 8;
    }

    let color = props.color || "#222";

    if (props.primary) {
        color = "#FD578B";
    } else if (props.secondary) {
        color = "#55E3AA";
    } else if (props.grey) {
        color = "#666";
    } else if (props.white) {
        color = "#fff";
    } else if (props.blue) {
        color = "#027ef2";
    }

    return {
        size,
        color,
        name: props.name
    }
})``;

